import React from "react";
import ReactDOM from "react-dom";
import "../componentCss/ContactFormCss.css";

class ContactForm extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="c-6 contact-wrapper">
        <p className="contact-message"> Để lại lời nhắn cho tôi </p>
        <input type="text" placeholder="Tên của bạn" className="form-input" />
        <input
          type="text"
          placeholder="Địa chỉ email "
          className="form-input"
        />
        <input
          type="text"
          placeholder="Số điện thoại liên lạc"
          className="form-input"
        />
        <input type="text" placeholder="Lời nhắn" className="form-input" />
      </div>
    );
  }
}

export default ContactForm;
